import React from "react";
import {ContainerNav, ImageNav} from "./carrosselStyle";
import { Swiper, SwiperSlide } from 'swiper/react';
import { Autoplay } from 'swiper';
import 'swiper/swiper-bundle.css';

export default function AppMain() {
    const SimpleSwiper = () => {
        return (
          <Swiper spaceBetween={50} slidesPerView={1}>
            <SwiperSlide>
              <ImageNav></ImageNav>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 2</div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 3</div>
            </SwiperSlide>
          </Swiper>
        );
      };
    return (
        <SimpleSwiper></SimpleSwiper>
    );
}

const AutoplaySwiper = () => {
  return (
    <Swiper
      spaceBetween={50}
      slidesPerView={1}
      loop={true}
      autoplay={{ delay: 3000 }}
      modules={[Autoplay]}
    >
      <SwiperSlide>
        <div>Slide 1</div>
      </SwiperSlide>
      <SwiperSlide>
        <div>Slide 2</div>
      </SwiperSlide>
      <SwiperSlide>
        <div>Slide 3</div>
      </SwiperSlide>
    </Swiper>
  );
};

const CubeEffectSwiper = () => {
  return (
    <Swiper
      effect="cube"
      cubeEffect={{
        shadow: true,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
      }}
      modules={[EffectCube]}
    >
      <SwiperSlide>
        <div>Slide 1</div>
      </SwiperSlide>
      <SwiperSlide>
        <div>Slide 2</div>
      </SwiperSlide>
      <SwiperSlide>
        <div>Slide 3</div>
      </SwiperSlide>
    </Swiper>
  );
};
